            position: fixed;
            left: 0;
            top: 0;
            right: 0;
            bottom: 0;
            background: #27283a;
            /* Old browsers */
            background: -moz-linear-gradient(top, #27283a 0%, #282b3f 50%, #3d3f5a 100%);
